import CartProvider from "../store/CartProvider";
import Footer from "./Footer";
import Header from "./Header";
import Title from "./Title";

const AboutUs=()=>{
    return <CartProvider>
        <Header/>
        <Title/>
        <div>
            Hello There
        </div>
        <Footer/>
    </CartProvider>
}

export default AboutUs;
